import React from "react";

const Login = () => {
  const authorizedLogin = () => {
    if (!emailField.trim() === "" && passwordField.trim() === "") {
      alert("Login Success");
    } else if (emailField.trim() === "") {
      alert("Insert Email");
    } else {
      alert("Insert Password");
    }
  };
  return (
    <>
      <div className="res-login-container">
        <h1>Login Section</h1>
        <label>Email or PhoneNumber</label>
        <br />
        <input
          type="text"
          placeholder="Email | PhoneNumber"
          value="emailField"
        />
        <br />
        <label>Password</label>
        <br />
        <input type="password" placeholder="Password" value="passwordField" />
        <br />
        <button onClick={() => authorizedLogin()}>Login</button>
      </div>
    </>
  );
};
export default Login;
